import React from 'react';
import { Register } from './Register';
import { Switch, Route} from 'react-router-dom';

import { Login } from './Login';

class Main extends React.Component {
    render() {
        return (
            <div className="main">
                <Switch>
                    <Route path="/register">
                        <Register />
                    </Route>
                    <Route path="/login">
                        <Login />
                    </Route>
                </Switch>
            </div>
    );
    }
}

export default Main;
